    [],nt"revision_timestamp": "2015-05-07T15:21:25.126817",nt"name": "space-electronics-operating-at-high-temperatures-and-radiation-levels-project",nt"isopen":
    true,nt"url": null,nt"notes": "The objective is to produce high efficiency
    DC/DC power modules in a small low profile package that can tolerate extreme environment
    conditions.  The primary effort of the Phase II program is to address the need for
    very high performance power electronics that meet a combination of high radiation
    tolerance, high thermal tolerance and extremely low EMI susceptibility/radiation.
    The power modules incorporate several radical new advances in power design including
    ceramic cores and quasi-linear circuitry.  The program will exit with such modules
    having been verified for thermal vacuum and electromagnetic (susceptibility and
    radiation) performance of modules that can tolerate &gt;0.3Mrad and &gt;200C operation
    with negligible electromagnetic coupling and extremely high electrical isolation.",nt"license_title":
